import { AccountBalanceWalletRounded, Chat, Favorite, HomeRounded, Settings, SummarizeRounded } from '@mui/icons-material';
import { useEffect } from 'react';
import './App.css';
import BannerName from './Components/BannerName';
import Header from "./Components/Header";
import MenuCard from './Components/MenuCard';
import MenuContainer from './Components/MenuContainer';
import SubMenuContainer from './Components/SubMenuContainer';

function App() {

      useEffect(()=>{
        const menuLi=document.querySelectorAll("#menu li")
       // console.log(menuLi);
       function setMenuActive(){
       // console.log("hi");
       menuLi.forEach((n)=>n.classList.remove("active"));
       this.classList.add("active");
       }


       menuLi.forEach((n)=>n.addEventListener("click",setMenuActive));

      },[]);

  return (
    <div className="App">
     {/*Header Section */}
     <Header/>
      {/* Main Container */}
      <main>
        <div className=" mainContainer"  >
         {/* Banner */}
         <div className='banner'>
         <BannerName name={"Vetri"} discount={"20"} link={"#"}  />
         <img src='https://firebasestorage.googleapis.com/v0/b/food-delivery-37c59.appspot.com/o/Images%2Fdelivery.png?alt=media&token=69b9823d-96df-452a-bd4e-14d27a4cc337' alt=''
         className='deliveryPic'
         />
         </div>
         {/* dishContainer */}
         <div className='dishContainer'>
          <div className='menuCard'>
            <SubMenuContainer name={ "Menu Category"}/>
          </div>
          <div className='rowContainer'>
            <div>
              <MenuCard imgSrc={"https://e7.pngegg.com/pngimages/692/669/png-clipart-big-burger-hamburger-fast-food.png" }
               name={"Burger"}
               isActive
               />

            </div>
          </div>
          <div className='dishitemContainer'>

          </div>

         </div>

        </div>
        <div className='rightMenux'></div>
      </main>


      {/* Bottom Menu */}
      <div className='bottomMenu'>
        <ul id='menu'>
          {/* prettier-ignore */}
          <MenuContainer link={'#'} icon={<HomeRounded/>} isHome />
           {/* prettier-ignore */}
           <MenuContainer link={'#'} icon={<Chat/>} />
            {/* prettier-ignore */}
          <MenuContainer link={'#'} icon={<AccountBalanceWalletRounded/>} />
           {/* prettier-ignore */}
           <MenuContainer link={'#'} icon={<Favorite/>} />
            {/* prettier-ignore */}
          <MenuContainer link={'#'} icon={<SummarizeRounded/>} />
           {/* prettier-ignore */}
           <MenuContainer link={'#'} icon={<Settings/>} />

           <div className='indicator'></div>

        </ul>

      </div>


    </div>

  );
}

export default App;
